css:
@-moz-document domain("mongoosejs.com") {
/** This is mostly meant for the docs section. Made by ZpeedTube **/

body{
    background-color: #17242d;
    color: #CCC;
}

a {
    color: #a4a4f4
}

h3 a {
    color: #CCF;
}

#menu {
    background-color: #17242f
}

.pure-menu-link {
    color: #dfc0c0;
}

#logo-container {
    background-color: #111;
}


.language-javascript {
    color: #fff;
}
.hljs-keyword {
    color: #99f;
}
.hljs-built_in {
    color: #3bf22d;
}
.hljs-string {
    color: #f2003d;
}
.hljs-comment {
    color: #c4c4bb;
}
.hljs-number {
    color: #cdec00;
}
.hljs-literal {
    color: #afafff;
}

code {
    background-color: #333;
    color: #ff8181;
}

pre, pre code {
    background-color: #333;
    color: #eee;
}

.tagline p {
    color: #a9cbff;
}
}
